      { name: "Piggott Skatepark", city_id: 171, state_id: 4, country_id: 1, description: "Small Skatepark that shares the concrete with a basketball court. There's a couple rails a small box with a stairset, a ledge and a table, that's all folks.", image: "https://www.concretedisciples.com/media/reviews/photos/original/30/ab/af/20926_piggotskatepark_1308021733.jpg", website: 'http://www.piggottparksandrecreation.com/skatepark.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '161 East Pfeiffer' },
      { name: "Regional Park Skatepark", city_id: 172, state_id: 4, country_id: 1, description: "It sucks but it's better than sittin on your ass and not skating!", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'regional park' },
      { name: "Pocahontas Skate Pad", city_id: 173, state_id: 4, country_id: 1, description: "It sux so bad that you sould go to the Mayor's office and threaten him to build us a new park cause it really really really really really really crapy!!!!!....so please come and take a look and tell the mayor that it isnt fair to have the skaters suffer a bad park while others have a True Ride park.....although some of the skaters are badass!!!!.......(Brendan Grooms,Ryun Blansett, and Ty Evers)", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: "NA" },
      { name: "Skateboard Pad Skatepark", city_id: 173, state_id: 4, country_id: 1, description: "There's one really bad funbox about 3' high. There's a little, and I stress LITTLE halfpipe. It's definitely not much to look at. So if you're ever in the area.....don't go there.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Just off the Black River bridge' },
      { name: "Skate Head", city_id: 174, state_id: 4, country_id: 1, description: "Crappy Skatepark nothing but little kids on boards or, cocky rollerfags, or bikers, it costs ten bucks to get in and you must wear a helmet. Never go there, trust me bro!", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '200 W. Olive' },
      { name: "Russellville Skatepark", city_id: 175, state_id: 4, country_id: 1, description: "Nice little skatepark with a small half bowl with quarter-ledges on either side, a stairset with ledge and a descent bank.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_2b_33_52_20340_russellvilleskatepark4_1294621867.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '205 S. Jonesboro' },
      { name: "Searcy Skatepark", city_id: 176, state_id: 4, country_id: 1, description: "outdoor wooden skatepark", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '801 South Elm' },
      { name: "Henry Park Skatepark", city_id: 177, state_id: 4, country_id: 1, description: "Description Needed", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '604 West Benton St' },
      { name: "Star City Skatepark", city_id: 178, state_id: 4, country_id: 1, description: "its got a spine 3ft tall ,a bench about 1 1/2 ft and about 5ft long, a box about a 1ft tall and about 7ft long, a hubba on the spine and we're getting another quarterpipe and a wedge :) come skate", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'highway 114' },
      { name: "Trumann City Skatepark", city_id: 180, state_id: 4, country_id: 1, description: "Free outdoor skatepark with restrooms.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'cedar st.' },
      { name: "Alameda Skatepark", city_id: 183, state_id: 5, country_id: 1, description: " It's a fun cruise around park. Steel coping in various spots, banks, a pyramid and ledges to get your tech on. Not too crowded these days now that the new Berkeley park is open which is much better and smoother. I'd give it a 5 out of 10.", image: "https://www.concretedisciples.com/media/reviews/photos/original/78/bb/df/19545_alameda6opt_1294779489.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1177 W. Redline Ave.' },
      { name: "American Canyon School TLC Skatepark", city_id: 185, state_id: 5, country_id: 1, description: "The skate park is all metal it has a half pipe, two fun boxes two rails three 10ft pipes three 3 ft pipes 4 6 ft pipes a couple of rails and a small and big launch ramp...", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/49/ed/f8/20759_americancanyonskatepark_1365627024.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'donaldson way' },
      { name: "South Volonte Skatepark", city_id: 187, state_id: 5, country_id: 1, description: "A few mistakes but turned out pretty well 11,500 sf - 6' bowl combination, 8'extension, and street course area.", image: "https://www.concretedisciples.com/media/reviews/photos/original/e1/ce/06/19546_andersonskatepark2_1294779730.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '20208 Olinda Rd.' },
      { name: "Antioch Skatepark", city_id: 188, state_id: 5, country_id: 1, description: "Nice concrete park with a shallow '8' bowl surrounded by rolled banks and ledges.", image: "https://www.concretedisciples.com/media/reviews/photos/original/64/68/eb/19547_antiochcaskatepark2_1294779906.jpg", website: 'http://www.ci.antioch.ca.us/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '4701 Lone Tree Way' },
      { name: "RampArt Collective Skatepark", city_id: 190, state_id: 5, country_id: 1, description: "RampArt features 4,000 square feet of indoor wooden ramps, artwork, and music for year round use. More than an athletic facility, RampArt offers a multitude of instructional courses and workshops to expose the community to new art forms and engage youth in constructive activities. The park is open evenings and weekends to the general public with after school hours tailored to youth. Although RampArt charges a nominal admission, we aim to keep fees affordable for all community members and offer programs to ensure everyone has the opportunity to participate regardless of income.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/ab/ad/8d/25134_rampartskatepark_1360798753.jpg", website: 'http://www.rampartskatepark.org/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '700 South G Street' },
      { name: "Arcata Skatepark", city_id: 190, state_id: 5, country_id: 1, description: " It has a 8 foot bowl, a snake run which is 4 foot in the shallow end winding down into a 6 foot bowl. It has a four foot tall pyramid and plenty of other weird lumpy cement things to make tricks up on. Cops will give you a ticket for no elbow pads, but you can sit and drink all day out front and never get hassled. Definitely a park to stop on if your on your way to Oregon via the 101.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/100x100c/7e/c4/3b/3dZ9xXhF688-v1601506255.jpg", website: 'https://www.facebook.com/pages/category/Park/Arcata-Skate-Park-158068300912569/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '900 Sunset Ave.' },
      { name: "George C. Beatie Atascadero Indoor Skatepark", city_id: 191, state_id: 5, country_id: 1, description: "Nice indoor wooden skatepark with a bit of everything, nothing huge.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/100x100c/68/2f/87/george-c-beatie-atascadero-indoor-skate-park-atascadero-california-u-s-a-36-1396374741.jpg", website: 'http://www.atascadero.org/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '5493 Traffic Way' },
      { name: "Osborn Skatepark", city_id: 192, state_id: 5, country_id: 1, description: "All prefab metal Ramps. Great quality though. This was an old set of tennis courts. Not bad for an afterthought park", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Bellevue' },
      { name: "Applegate Skatepark", city_id: 192, state_id: 5, country_id: 1, description: "A free concrete park that is 7,500 square feet. Has moderate sized banks pyramids, ledges, and stairs.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/d6/75/f4/ay36H7DV5IU-v1543803103.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Applegate Rd' },
      { name: "Auburn Skatepark", city_id: 193, state_id: 5, country_id: 1, description: "Outdoor concrete park", image: "https://www.concretedisciples.com/media/reviews/photos/original/f7/a8/a4/19549_auburnopt_1294780143.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Gum Lane and Pacific Ave' },
      { name: "Avenal Skatepark", city_id: 194, state_id: 5, country_id: 1, description: "Outdoor concrete park", image: "https://concretedisciples.com/wp-content/uploads/2013/04/media_reviews_photos_original_01_42_59__AvenalCaliforniaskatepark_1366236291.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: "NA" },
      { name: "Benicia X-Park Skatepark", city_id: 198, state_id: 5, country_id: 1, description: "It has a cool street section that tunnels thru a quarter pipe area and waterfalls into a 9 foot bowl. It is fast! It also has a left hand kidney pool w/pool coping. It has a square bowl with a vert wall and a roll in that connects the square bowl with the 9 ft. bowl. Around the outside of the park there is a small 2 or 3 stair and some ledges.", image: "https://www.concretedisciples.com/media/reviews/photos/original/f1/66/0e/21120_beneciaskatepark2_1294780326.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Community Park Dr' },
      { name: "Orkin/Hsiang Memorial Skatepark", city_id: 199, state_id: 5, country_id: 1, description: "The bowl has a 4' mellow shallow end (kind of like the small part of Ripon) and the deep end is 8' with no vert. there are lumps in the deep end of the bowl and all over the flat banks in the street course. There's a bunch of lumpy flat banks and weird hips to pop off, a euro-gap thing, a pump bump turtle shell thing, a roller/fun box thing that has a vert wall next to it (the only vert in the park, one foot of vert) abd a couple of cups/corners to whip speed lines through. And you most certainly can haul ass and get some speed lines going in the street course, but if there are more than 2-3 people riding it at the same time get your elbow up and get ready to take some kids/bladers/kooks out.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/1a/67/93/19550_berkeleyoverview2opt_1294780542.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5th and Harrison' },
      { name: "Biggs Skatepark", city_id: 201, state_id: 5, country_id: 1, description: "It consists of 4 obstacles. They are as follows: a small circular platform with a section of very short outside radius stairs with rails, a small pyramid, a high ledge, and a very tall rail that nobody could get onto, and one guy cut his arm pretty badly on as it had exposed metal burs. This is also a very small rural town with a healthy helping of hucksters that 'don't cotton to outsiders', but they just yell things from their trucks when driving by.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/48/11/87/biggs-skatepark-biggs-california-usa-67-1543803525.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '9th Street and C Street' },
      { name: "Bishop City Skatepark", city_id: 202, state_id: 5, country_id: 1, description: " It has a 4 stair, good for people that skate goofy, the bowl is nice and the pyramid has a box that's good for grinding and for flip tricks. Wear pads and helmet because the cops are ruthless and like to make money from all the tickets they give to innocent skateboarders and bikers that are legally allowed to ride California skateparks but this skatepark does not allow bikers.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/00/12/df/19551_bishopskatepark1_1294780738.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'N. Main St. and Park Ave' },
      { name: "Mesa Skatepark", city_id: 203, state_id: 5, country_id: 1, description: "Bolinas Bark Has A Makeshift Spine, a crappy 4ft halfpipe in serious Disrepair, a handrail, a ledge, a copingless qp and Great 6ft mini with 2 7ft extensions that is slightly disproportionnate. One side is 6 1/2 feet, the other 6, but most of the people who come here are kids who cant drop in and old stoner skate veterans, so you won't notice it. A bowl and revamped street course came in 2006.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/59/3a/0e/uO7bC6Prsrw-v1396375120.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Mesa Rd.' },
      { name: "Brentwood Skatepark", city_id: 205, state_id: 5, country_id: 1, description: "A concret skatepark with just about everything to keep every rider happy.", image: "https://www.concretedisciples.com/media/reviews/photos/original/d0/5a/76/20188_brentwoodskatepark5_1294780863.jpg", website: 'http://www.skateparkcentral.com/brentwood.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '198 Griffith Lane' },
      { name: "Cameron Park Skatepark", city_id: 210, state_id: 5, country_id: 1, description: "All concrete, street style course with cramped ledges, some tranny sections, your basic small city park....yuppy child entertainment facility. Easily seen from freeway on north side of Hwy 50. Free, pads and helmets required, hours vary", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Cambridge and Merrychase' },
      { name: "Campbell Skatepark", city_id: 211, state_id: 5, country_id: 1, description: "About the Skate Park - The Campbell Skate Park is a supervised facility and only open during specified hours. For safety reasons, only authorized skaters, with liability release forms on file, and required safety gear will be allowed admittance.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/a4/23/1f/b49b52_oqZg-v1396374555.jpg", website: 'http://www.ci.campbell.ca.us/communityandarts/skatepark.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'E. Campbell Ave. and Winchester Blvd.' },
      { name: "McGregor Skatepark", city_id: 212, state_id: 5, country_id: 1, description: "Outdoor concrete park", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/47/63/57/GjPyqAKg_WU-v1467822442.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'McGregor Dr' },
      { name: "La Sierra Skatepark", city_id: 215, state_id: 5, country_id: 1, description: "Park terrain: This new city-run skate park features a 6-foot miniramp, a 12-foot vertical ramp and a street course with rails and quarterpipes. Pads are required, and a fee is charged to skate.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5325 Engle Road' },
      { name: "Adobe Skatepark", city_id: 216, state_id: 5, country_id: 1, description: "very small and limited offerings.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/7d/af/31/7qIOYchK6e4-v1396374858.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '20373 San Miguel Ave.' },
      { name: "Castroville Skatepark", city_id: 217, state_id: 5, country_id: 1, description: "Skatewave designed and built", image: "NA", website: 'http://www.northmontereycountychamber.org/parksandrec.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '11261 Crane Street' },
      { name: "Chico Skatepark", city_id: 219, state_id: 5, country_id: 1, description: "You can get lots of speed, it has a huge bowl, its really tall(10' maybe), but it has curved edges, so you down drop down. You can be grinding on the 1/4 pipes all around the park. It had some jumps and some gaps you can land. Its a great park. There are 1/4 pipes all the way around, some you don't have to push hardly at all. It has long rail, a few tall and a few shorts. Its fenced in, but the front gate is this cool artwork of skaters. The place is covered with skating art, not graffiti, but cool art. You can tell the locals cherish this park, because its really clean. I mean it, its cleaner than Chico itself.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/2d/b1/f8/19561_chicoskatepark1_1294802510.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '300 Humbolt' },
      { name: "Surf and Skate Skatepark", city_id: 221, state_id: 5, country_id: 1, description: "most surfaces are 100% Skatelite and the street course is off the frikkin hook too we use lots of marble and poured in place concrete for the major grinding surfacesâ€¦ that marble is like running out on the ice in your skate shoes!!", image: "NA", website: 'http://www.surfandskate.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '7411 Greenback Lane' },
      { name: "Rusch Park Skatepark", city_id: 221, state_id: 5, country_id: 1, description: "nearing completion.(8/8/03) Great looking skatepark with unique features. Just look at the photos and you will see what I mean. Park opens sometime September 03. Unsupervised, helmets required. NO BIKES AT ALL!!!!!!", image: "https://www.concretedisciples.com/media/reviews/photos/original/bb/6f/ef/19172_citrusheightsskatepark3_1294802698.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Antelope road and Auburn blvd.' },
      { name: "Clearlake Skatepark", city_id: 223, state_id: 5, country_id: 1, description: "Outside masone prefab skatepark on slab with a bit of everything but nothing big.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/17/34/04/18905_clealakeskatepark1_1294803000.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Austin Park' },
      { name: "Cloverdale Boys & Girls Club Skatepark", city_id: 224, state_id: 5, country_id: 1, description: "Skatewave park", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '76 Tarman Dr' },
      { name: "Clovis Skatepark", city_id: 225, state_id: 5, country_id: 1, description: "At a glance, the pool looked fun, but after a few runs i found it kinky and the concrete lumpy. I rode the flow area just past the shallow end of the pool, and also found that lumpy and kinked.", image: "https://www.concretedisciples.com/media/reviews/photos/original/b9/09/6c/clovis-skatepark-clovis-california-u-s-a-13-1404944255.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Villa Ave At W 9th St.' },
      { name: "Concord Skatepark", city_id: 227, state_id: 5, country_id: 1, description: "Concrete. One bowl. Cement half pipe. pillars.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_9a_b5_d3_19054_concordskatepark1_1294803262.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Galindo St. and Cowell Rd' },
      { name: "Corning Skatepark", city_id: 228, state_id: 5, country_id: 1, description: "Road trip worthy- simply amazing. Park just flows and goes on and on. Great rare features like the super mellow clamshell, bricked hip, stair-ledge-flat bank combos that you can roll over. Something for everyone, tiny quarters, mellowed transitions to medium. The snake run flows really nice, too bad it's not pool coping. 6 ft shallow end to 10' maybe.", image: "https://www.concretedisciples.com/media/reviews/photos/original/dd/1f/4e/corning-skatepark-87-1437261508.jpg", website: 'https://www.facebook.com/skateandbikepark?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1485 Toomes Ave' },
      { name: "Corte Madera Skatepark", city_id: 231, state_id: 5, country_id: 1, description: "This park SUCKS. Please don't even waste your time. Crappy plastic ramps. The only thing worth anything is the spine, but it's not worth it, man. Don't bother.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Pixley Ave and Tamalpais' },
      { name: "Crescent City Skatepark", city_id: 233, state_id: 5, country_id: 1, description: "Big roll in with a funbox in middle then a quarter pipe a spine with little roll in and a little quarter pipe a bank with a little 6 stair with rail in middle and a fly box on the other side with bench in very middle of park.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_d0_81_47_20008_crescentcityca_1294804355.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '501 5th st' },
      { name: "Community Park Skatepark", city_id: 236, state_id: 5, country_id: 1, description: "Park terrain: Free concrete park with ramps. Open exclusively for skateboarding 4 to 9 p.m., Wednesday and Thursday; 3 to 11 p.m., Saturday; and 11 a.m. to 3 p.m., Sunday. All participants must have a signed liability waiver form on file, and parents of skaters under age 18 must come to the park to sign the form.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/36/0e/fd/19562_davisskatepark1_1294804499.jpg", website: 'http://www.city.davis.ca.us/pcs/facility/details.cfm?id=6D611BF6-8EE0-44D9-93EC73C503A1A5C1&type=Park?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1405 F St.' },
      { name: "Delano Skatepark", city_id: 237, state_id: 5, country_id: 1, description: "Very good. Delano is a small town and not a whole lot of skaters. You could rip with little traffic and also NO PADS. Also, located in a public park you can walk off to get your tall can on. Nothing under 6 ft. fast concrete with parts of coping still un-grinded.", image: "https://www.concretedisciples.com/media/reviews/photos/original/4a/82/d2/20369_delanoskatepark3_1294804634.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Cecil ave. and Madison St.' },
      { name: "Delhi Skatepark", city_id: 238, state_id: 5, country_id: 1, description: "Outdoor skatewave park", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Shanks Rd & Schendel Ave' },
      { name: "Dixon Skatepark", city_id: 239, state_id: 5, country_id: 1, description: "hell fun on a bike", image: "https://www.concretedisciples.com/media/reviews/photos/original/7e/b5/46/20812_dixonskatepark3_1294804776.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'hall park' },
      { name: "Dublin Skatepark", city_id: 240, state_id: 5, country_id: 1, description: "Extremely lumpy bowls if you can call them that. The transitions are weird and will toss you off balance. If you are into skating unskateable stuff, this is your park", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/fd/c6/e0/18991_dub1opt_1294804918.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Tassajara and Gleason Dr.' },
      { name: "Rainbow Recreation Center", city_id: 241, state_id: 5, country_id: 1, description: "Outdoor skatepark", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5800 International Blvd' },
      { name: "El Dorado Hills Skatepark", city_id: 244, state_id: 5, country_id: 1, description: "Has a small halfpipe, some ledges, a couple rollins, a box and a mild spine.", image: "https://www.concretedisciples.com/media/reviews/photos/original/f7/99/78/20884_EDHCSDSkatePark_1349825114.jpg", website: 'http://www.filmtahoe.com/asp/EDH_Skate_Park.asp?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1021 Harvard Way' },
      { name: "Morse Park", city_id: 245, state_id: 5, country_id: 1, description: "Tiny little 3' mini 3/4 bowl or mini ramp- 3' mini ramp or bowl? It's got 3 corners but it's open on the 4th to the sidewalk. It's got nice steel coping; concrete is holding up alright.", image: "https://concretedisciples.com/wp-content/uploads/2015/08/media_reviews_photos_original_70_13_f1_morse-park-53-1439353732.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5540 Bellaterra Dr' },
      { name: "Derr-Okamoto Skatepark", city_id: 245, state_id: 5, country_id: 1, description: "medium street features flowing into a bowl with extensions, a roll in and BMX fly box. This beautiful brand new park has something for everyone from a variety of transition features to perfect medium-sized street features. Featuring: combo ledge/manual pads, 3 stair sets, A-Frame ledge, step-up gap, a bank to vert wall, and a bowl area with shallow/deep ends and a big BMX fly box.", image: "https://www.concretedisciples.com/media/reviews/photos/original/25/74/1d/IMG-4696-57-1370279202.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '9550 Mainline Drive' },
      { name: "Elk Grove Teen Center Skatepark", city_id: 245, state_id: 5, country_id: 1, description: "Outdoor Concrete Park", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'off of bond road' },
      { name: "Elk Grove Skatepark", city_id: 245, state_id: 5, country_id: 1, description: "Its a pretty decent park. It kinda feels like your in a prison though. Big burly fences, camera monitoring and lots of rules. I liked the little bowl for beginners, its like a good mini ramp", image: "https://www.concretedisciples.com/media/reviews/photos/original/1f/fe/b6/19564_elkgroveskatepark5_1302054278.jpg", website: 'https://www.yourcsd.com/346/Skate-Parks?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '9014 Bruceville Road' },
      { name: "Eureka Skatepark", city_id: 248, state_id: 5, country_id: 1, description: "Outdoor concrete park with tons of stuff.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/a2/27/ce/21113_eurekaskatepark1_1294805297.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1720 10th Street' },
      { name: "Travis AFB Skatepark", city_id: 249, state_id: 5, country_id: 1, description: "A 6ft mini-ramp. Two banks, two (wedge style) quarter pipes. a spine, pyramid, a kink rail and a box rail. Pretty cool but not much flow. Helmets enforced but not pads.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Travis Air Force Base' },
      { name: "Allan Witt Rotary Skatepark", city_id: 249, state_id: 5, country_id: 1, description: "This skatepark is ok but not enought street. There's a seven stair with a hand rail, ummmm, two small (i meen very small) pyramids, one big one in the middle two bowls, one mini vert a spine ", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Woolner Ave. and Vine Dr.' },
      { name: "Maldonado Skatepark", city_id: 250, state_id: 5, country_id: 1, description: "Description Needed", image: "https://www.concretedisciples.com/media/reviews/photos/original/62/4e/ea/24552_firebaughskatepark6_1327898392.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Clyde Fannon Rd. and Thomas Conboy Rd.' },
      { name: "Fremont Skatepark", city_id: 253, state_id: 5, country_id: 1, description: "Lotsa fun for all.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/21/78/ac/_fremontupdate01_1342565676.jpg", website: 'http://www.fremont.gov/index.aspx?NID=1563?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Paseo Padre Pkwy' },
      { name: "Folsom Skatepark", city_id: 251, state_id: 5, country_id: 1, description: "It features a giant combi bowl at 10 feet deep, a square bowl to the right, a round bowl to the left, an 8 foot deep middle section that ties to a 6 foot deep left side and a 4 foot deep right side. 4 chambered with round hips, 45's, and 90's. All metal coping. Big extensions in the 4 foot and in the 8 foot middle section. The 8 foot middle one has a channel in the middle, used for entry and for airs over. Really nice design, really smooth and fast. The flow area is fun too, small, but you can launch from the 4 foot deep part right over the platform into the banks of the flow. A few street objects surround the bowl and flow area for the kiddies to railslide and sit on while watching the session. It's only 2 dollars and it is open till 9 or 10 depending on the time of year. Best park in the Sacramento area by far, and only an hours drive from Strawberry bowl, so do a double header if you do the Folsom thing. It is a half hour from downtown Sacramento. N Men are the locals and they are pretty cool.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/dc/7c/1e/18886_folsomskatepark_1294805431.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1775 Creekside Dr.' },
      { name: "Mosqueda Bike Park", city_id: 254, state_id: 5, country_id: 1, description: " I didn't jump the fence, so I'm not sure how tight the security would be if you did. There are also numerous signs stating that this park is for bikes only, and skateboards are not allowed. Once the gates open, that might change, but again I don't know. All that being said- this place looks like fun. Most of the obstacles are large, and it seems that you could go really fast.", image: "https://www.concretedisciples.com/media/reviews/photos/original/ad/ff/c4/mosqueda-bike-park-fresno-california-usa-54-1470933895.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '4670 E. Butler' },
      { name: "Lion's Den Skatepark", city_id: 254, state_id: 5, country_id: 1, description: "This park is tight! Has a 6 foot tall snakerun transitioning into a 8.5 foot deep bowl! Three pyramids, most have ledges or rails going on or down them. Some ledges that are twenty feet in length that slant into the middle of the park. Some definitely usual objects to skate. Plus Ryan Johnson frequents the park often. GOOD!!!!!! There are lights until 10pm. I heard pads are starting to be enforced.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/dc/1c/63/19566_fresnoskatepark1_1294805596.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '4650 N. Marks' },
      { name: "Galt Skatepark", city_id: 256, state_id: 5, country_id: 1, description: "Skatewave skatepark with a very shallow halfpipe, low rollins and low box.", image: "https://www.concretedisciples.com/media/reviews/photos/original/c1/56/33/20886_galtskatepark1_1294806744.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '660 Chabolla Ave' },
      { name: "Las Animas Skatepark", city_id: 258, state_id: 5, country_id: 1, description: "all concrete", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Wren Ave. and Mantelli' },
      { name: "Gonzales Skatepark", city_id: 260, state_id: 5, country_id: 1, description: "Skatewave park", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '205 Elko St & First St' },
      { name: "Grass Valley Skatepark", city_id: 261, state_id: 5, country_id: 1, description: "On top of that they won't let bikes or scooter in any more which I think sucks.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Minnie St. and Butler' },
      { name: "Greenfield Skatepark", city_id: 262, state_id: 5, country_id: 1, description: "This park is great. There is a huge bowl with great transition and a bunch of hips that takes up one side of the park and then there is a bunch of ledges, a few quarters and rails on the other side. There is a part of the park with useless ledges piled on top of each other, but plenty of things to be ridden.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/e0/21/15/19568_greenfieldskatepark1_1294806844.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Oak Ave. and 13th St.' },
      { name: "Gridley Skatepark", city_id: 263, state_id: 5, country_id: 1, description: "The best metal ramps on concrete I've seen in CA. That said- its metal ramps on concrete. Its loud and clanky. There is a little bit of flow here; but you have to work it. There is a metal corner pocket. There are some little 1-1/2' quarters without coping for some little ramp action. Highlight here is the 3ft mini ramp. Its got big decks.", image: "https://www.concretedisciples.com/media/reviews/photos/original/e4/fd/28/skatepark-gridley-california-usa-88-1442097628.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Spruce St. and Washington St.' },
      { name: "Groveland Skatepark", city_id: 264, state_id: 5, country_id: 1, description: "Outdoor metal skatepark", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '18636 Main St' },
      { name: "H-Town Skatepark", city_id: 265, state_id: 5, country_id: 1, description: "it's not that fun if you come from a town with a huge park but decently fun to visit and shred", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/e9/c9/4d/20176_hanfordskatepark_1294814250.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '415 Ford St' },
      { name: "Hayward Skatepark", city_id: 266, state_id: 5, country_id: 1, description: " street stuff is pretty whack, put who wants to skate street in a skate park anyways? The bowl's have really good pumpitude, you can fly around , and around in them and go real fast.. Nothing really over 5 ft, typical or the retarded park designers in CA.", image: "https://www.concretedisciples.com/media/reviews/photos/original/a3/7c/e4/19569_haywardpark2opt_1294814382.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'W Tennyson Rd and Huntwood Ave' },
      { name: "Carson Warner Skatepark", city_id: 267, state_id: 5, country_id: 1, description: "Outdoor concrete", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_09_12_cb_19554_healdsburgskatepark_1294814574.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1300 Grove St.' },
      { name: "Hollister Skatepark", city_id: 268, state_id: 5, country_id: 1, description: "There is a cute little bowl which is great for all skaters, the shallow end has no coping and makes it easy for newer skaters to skate in and out of it, and the deeper end has concrete coping so you can still do tricks with coping. There is another area on a slab of asphalt with metal ramps. theres a half pipe thats probably about 5.5 ft tall and a bunch of different metal ramps that you can get a sweet little run on. just be very careful for the pebbles on the asphalt, they will send you flying on your harder wheels.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Memorial Dr.' },
      { name: "Amador Skatepark", city_id: 273, state_id: 5, country_id: 1, description: "These ratings might seem high, but you must realize that this is a tiny park that packs a great punch for its size. The pool is killer.", image: "https://www.concretedisciples.com/media/reviews/photos/original/13/e7/df/amador-skate-park-ione-73-1574745794.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '124 and W. Plymouth Hwy.' },
      { name: "King City Skatepark", city_id: 275, state_id: 5, country_id: 1, description: "It's a free wooden outdoor skatepark. A 'ripping' street course", image: "https://www.concretedisciples.com/media/reviews/photos/original/4d/0c/a2/19571_kingcity10opt_1294815392.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Broadway St and San Antonio D' },
      { name: "Lathrop Skatepark", city_id: 279, state_id: 5, country_id: 1, description: "Cement skatepark with hotdog rails, a few ledges of varied sizes, a huge curved wedge.", image: "https://concretedisciples.com/wp-content/uploads/2014/04/media_reviews_photos_original_c3_e1_da_lathrop-skate-park-56-1397000314.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '450 Spartan Way' },
      { name: "Lemoore Skatepark", city_id: 280, state_id: 5, country_id: 1, description: "Outdated...But better than nothing.", image: "NA", website: 'https://lemoore.com/departments/park-and-rec?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '300, E Street' },
      { name: "McBean Skatepark", city_id: 281, state_id: 5, country_id: 1, description: "10,000 Sq Ft. small ramp park.", image: "https://www.concretedisciples.com/media/reviews/photos/original/45/bc/74/19572_lincolnskatepark1_1294815563.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '625 McBean Park Dr.' },
      { name: "Livermore Skatepark", city_id: 282, state_id: 5, country_id: 1, description: "This is small but very nice and smooth. Has a pair of mickey mouse ear bowls, a 3 quarter pyramid, sort of a miniramp styled bowled thing, some ledges around the perimeter and some other odds and ends. Flowable transitions. It's located in a dirt lot behind a school. No restrooms, water fountain, lights or anything else there (!?) ", image: "https://www.concretedisciples.com/media/reviews/photos/original/06/9f/9b/19573_livermoreskatepark1_1294815839.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Pacific Ave and S Livermore Ave' },
      { name: "Lodi Skatepark", city_id: 283, state_id: 5, country_id: 1, description: "$5/skate session, $7/bmx session full pads required outdoor park, street and vert course", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/40/c0/d1/19574_lodiskatepark_1350673943.jpg", website: 'http://www.actionparkalliance.com/lodi/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1145 S. Ham Ln.' },
      { name: "Lone Pine Skate Plaza", city_id: 285, state_id: 5, country_id: 1, description: "Free outdoor concrete park with a couple of nice stairsets. ", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/5b/15/dd/25077_lonepineskatepark1_1351099868.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'S. Main Street and Inyo St.' },
      { name: "Loyalton Skatepark", city_id: 288, state_id: 5, country_id: 1, description: "Mid sized concrete park containing several boxes, a six stair with ledges on both sides, and a 3.5/4.5 foot bowl with a 2 foot island. There is also a 4.5/5 foot roll in that stretches over half the park. It's a small park but it's hardly used. Helmets required and the transitions on the boxes are a little steep but it's otherwise great.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/74/bd/e0/19181_loyaltonskateparkca_1294816037.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'beckwith rd. and poole lane' },
      { name: "Zero Gravity Skatepark", city_id: 289, state_id: 5, country_id: 1, description: "Pay to ride outdoor concrete park", image: "https://www.concretedisciples.com/media/reviews/photos/original/de/36/36/20820_maderaskatepark1_1294816195.jpg", website: 'http://www.cityofmadera.org/Parks_and_Community_Services/Skate_Park_info.pdf?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '920 Gateway Dr.' },
      { name: "Volcom Brothers Skatepark", city_id: 291, state_id: 5, country_id: 1, description: "Super sick giant skatepark. Super sick giant skatepark. Ride some rocks, a massive cradle, ditch, vert bowl, flat box, ledges, gap, love seat, over vert, cinderblock tombstone, pump bumps, pool coping.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_67_fe_d4_20305_mammouthskatepark1_1294816490.jpg", website: 'http://www.volcom.com/news/article.asp?sid=&articleID=894?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Wagon Wheel Rd. and Meridian Blvd.' },
      { name: "Mammoth Skatepark", city_id: 291, state_id: 5, country_id: 1, description: "Pretty crappy outdoors and free. Mainly has a bump with a fire hydrant, some freeway dividers, a concrete quarter pipe a lame low rail.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Sawmill Cutoff Rd and Sawmill rd.' },
      { name: "Manteca Skatepark", city_id: 292, state_id: 5, country_id: 1, description: "There is 2 bowls, one 4' deep and round, the other is around 7' deep, both have a small waterfall into them. The crete is not very fast. It's nothing fancy but we had plenty of fun skating the bowls which have mellow transitions.", image: "https://www.concretedisciples.com/media/reviews/photos/original/9f/6b/c6/22032_mantecaskatepark3_1318613657.jpg", website: 'http://www.ci.manteca.ca.us/parks/skate.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Center Street and Elm Ave.' },
      { name: "Marina Skatepark", city_id: 293, state_id: 5, country_id: 1, description: "Here is the new Marina pool, its small, little vert, Pembrose pool coping, smooth.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_6f_e8_15_19576_marinabowllrg_1294816689.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '304 Hillcrest Ave.' },
      { name: "Mariposa Skatepark", city_id: 294, state_id: 5, country_id: 1, description: "Outdoor concrete, free.", image: "https://www.concretedisciples.com/media/reviews/photos/original/6d/05/29/19376_mariposaskatepark1_1294817047.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '4998 County Park Rd' },
      { name: "Martinez Skatepark", city_id: 295, state_id: 5, country_id: 1, description: "This park is pretty sick. It's got nice coping, smooth concrete, and it's rarely packed. Quarter pipes, a nice big bowl, w/ a twinkie/hip, a long spine, some decent metal coped ledges, w/ a box and square rail. Good starter ramps for speed.", image: "https://www.concretedisciples.com/media/reviews/photos/original/c0/d5/a6/20359_martinezskatepark2_1294817445.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '243 N. Court St.' },
      { name: "Miners Park", city_id: 296, state_id: 5, country_id: 1, description: "A slab of 'Crete in a park Some rails, ledges etc One ramp and one concrete median A ramp, a concrete median barrier, some rails.", image: "https://www.concretedisciples.com/media/reviews/photos/original/aa/da/9f/miners-park-marysville-66-1442087586.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '201 east 14th st' },
      { name: "Mather Sports Center Skatepark", city_id: 297, state_id: 5, country_id: 1, description: "Free outdoor concrete skatepark", image: "https://www.concretedisciples.com/media/reviews/photos/original/2d/5a/80/21123_matherskatepark2_1294817515.jpg", website: 'http://www.crpd.com/index.php?option=com_content&task=category&sectionid=5&id=36&Itemid=84?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '3755 Schriever Avenue' },
      { name: "Burgess Skatepark", city_id: 298, state_id: 5, country_id: 1, description: "Great bowl with tranny 4-9ft high. Smaller street area, but still fun. Lots of scooters in the mid-morning.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_e5_47_c0_20247_menloparkskatepark_1294817692.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '700 Alma Street.' },
      { name: "Mill Valley Skatepark", city_id: 300, state_id: 5, country_id: 1, description: "Skatewave skatepark", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '180 Camino Alto' },
      { name: "Modesto Skatepark", city_id: 301, state_id: 5, country_id: 1, description: "Old, very steep, and super lumpy park. There is no coping just rounded over crete that you can't grind, unless maybe you have 169's and small wheels. Almost all the tranny (4'-7')goes to vert even the short stuff. Most of the tranny is 6' tall. A good size snake run has some lines, but it has some super sketchy tranny near the end so carve at the top and around the end to prevent killing yourself. There is also a large 3/4 bowl area with a half pyramid on the side and a huge pyramid that's VERY steep in the center. There's lines in this area and it's probably the most skateable of the whole park. If you were to skate this place every day you would rip everywhere eles. No place for a rookie! SKETCHY AS IT GETS!", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Forest Glenn Drive at Sylvan Avenue' },
      { name: "El Estero Skatepark", city_id: 302, state_id: 5, country_id: 1, description: "Bad design, bad concrete work. I skated for 5 minutes and cut out. Whoever designed and built it must have never seen a skatepark before. You could have more fun skating a local curb", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/63/8d/80/18956_monterreybayskatepark1_1294818107.jpg", website: 'http://www.montereyparks.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'El Estero Park' },
      { name: "Moraga Skatepark", city_id: 303, state_id: 5, country_id: 1, description: "The park is pretty small... a triangular shape, a 5ft bowl thats got a hip on one side and bowled on the other. If you're familiar with the Milpitas Vans elbowed mini... imagine that 5ft tall and bowled ends... The bowl is surrounded by a street area with a strange choice of transitions that start on one end and then all of a sudden there are some stairs.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/33/82/0f/19579_moragaskatepark1_1294818366.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: "moraga rd and St. Mary's Rd." },
      { name: "Morgan Hill Skatepark", city_id: 304, state_id: 5, country_id: 1, description: "This 16,000 square foot park features a street course with a variety of stairs, pads, ledges, and a rock gap flowing into the bowl designed for both BMX and skating. Recently made free.", image: "https://www.concretedisciples.com/media/reviews/photos/original/38/a5/3a/IMG-0691-77-1370621150.jpg", website: 'http://www.morganhill.ca.gov/index.aspx?NID=831?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '171 Edmondson Dr.' },
      { name: "Rockies Skatepark", city_id: 305, state_id: 5, country_id: 1, description: "Inside/Outside with a mixture of riding surfaces and bathrooms. There's a proshop and it's free!", image: "NA", website: 'http://www.morro-bay.ca.us/index.aspx?nid=306?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '231 Atascadero Rd.' },
      { name: "Mires's Skatepark", city_id: 306, state_id: 5, country_id: 1, description: "Outdoor metal park. Free and pads are required.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'S Rengstorff Ave and Central Expy' },
      { name: "Napa Skatepark", city_id: 307, state_id: 5, country_id: 1, description: "Free 30,000 square foot outdoor concrete park.", image: "https://www.concretedisciples.com/media/reviews/photos/original/be/b2/4b/napa-skatepark-11-1548524155.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: "NA" },
      { name: "Napa Rip Zone Skatepark", city_id: 307, state_id: 5, country_id: 1, description: "Indoor/outdoor park with a mixture of riding surfaces. Free.", image: "https://www.concretedisciples.com/media/reviews/photos/original/ae/73/f8/19114_napaskatepark2_1294818521.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Pearl St and West St' },
      { name: "Newark Skatepark", city_id: 309, state_id: 5, country_id: 1, description: "Concrete park. 12500 square feet.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/b9/55/36/_mjpVDUEVrw-v1569523011.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '6800 Mowry Ave' },
      { name: "Hamilton Skatepark", city_id: 312, state_id: 5, country_id: 1, description: "Mostly bowls in the 5' range, there are a variety of hips, lines and transfers to do. The biggest wall is 6' but it is far away from the rest of the bowls, and you have to battle the street flyout kids to get to it. The coping is pretty good, but some of the transitions fade at the top", image: "https://www.concretedisciples.com/media/reviews/photos/original/bc/19/be/19584_crazyeddietransferopt_1294818632.jpg", website: 'http://www.cityofnovato.org/prcs/SkatePark.cfm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1200 Hamilton Parkway' },
      { name: "Boys and Girls Club", city_id: 313, state_id: 5, country_id: 1, description: "a half pipe two Qpipes funbox kink rail pyramid tabletop rollin bank small funbox curved rail long funbox", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_3f_28_28_boys-and-girls-club-skatepark-oakhurst-california-usa-61-1543802696.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'school rd' },
      { name: "Youth Uprising Skate Plaza", city_id: 314, state_id: 5, country_id: 1, description: "This plaza is full of marble ledges, hubbas, and banks. There is also a triple euro gap with three heights, stair sets with a rail, and quarter pipe hips.", image: "https://www.concretedisciples.com/media/reviews/photos/original/23/08/8d/Oakland-CA-7-24-1370622714.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '8601-8751 MacArthur Blvd' },
      { name: "Orange Cove Skatepark", city_id: 319, state_id: 5, country_id: 1, description: "the boosted overall rating is due to several factors: it is free, it has lights, there is a very cool vibe there, the mayor (who we met) is totally pro skater and is very cool, and the place is huge.", image: "https://www.concretedisciples.com/media/reviews/photos/original/c1/06/9f/20273_orangecoveskatepark3_1294818812.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'S. Anchor Ave. and Parlier Ave.' },
      { name: "Bedrock Skate and Bike Park", city_id: 320, state_id: 5, country_id: 1, description: "The park is a 'split' park, with bikes/skates rotating weekly, although nobody honors the designation. One half is all ramps, and sports a pretty good halfpipe with skatelite surface. It is never crowded as nobody rides it. The other half has ramps and a large bowl structure. The bowl has tight bottom transitions, with large semi-vert sections. The park was designed by bikers, for bikers, and it shows. If you are a vert skater though, the half-pipe is well worth the visit.", image: "https://www.concretedisciples.com/media/reviews/photos/original/0c/87/d5/20779_orovilleskatepark1_1294819007.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1100 Feather River Blvd' },
      { name: "Pacifica Skatepark", city_id: 323, state_id: 5, country_id: 1, description: "There's a good mix of regular and pool coping at this concrete park. Because it begs for long, stretching runs it sometimes feels crowded. The larger bowl is challenging and unusual, and rarely skated, so if the other parts of the park are crowded, dive in to the bowls.", image: "https://www.concretedisciples.com/media/reviews/photos/original/00/e7/97/20546_pacificaskatepark4_1294857067.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '540 Crespi Dr.' },
      { name: "Greer Park", city_id: 327, state_id: 5, country_id: 1, description: "Very Old School! No coping to grind on.", image: "https://www.concretedisciples.com/media/reviews/photos/original/c3/3f/7f/19585_paloaltoopt_1294857227.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'W Bayshore Rd and Colorado Ave' },
      { name: "Petaluma Skatepark", city_id: 329, state_id: 5, country_id: 1, description: "this is local thrashin par., dont go ther with your youngins, they will just get hit or yelled at. never go on a slighty rainy day, fog etc. too slippery even for non wet conditions.", image: "https://www.concretedisciples.com/media/reviews/photos/original/e1/c8/50/20470_petalumaskatepark3_1294857493.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'E Washington St and Fairgrounds Dr' },
      { name: "Ramp Rats Skatepark", city_id: 329, state_id: 5, country_id: 1, description: "It features 8000 sq. feet of skate and bike terrain and also houses a BMX and skate shop. Complete bikes, parts, boards, clothes, candy, snacks, and beverages are all for sale as well as a lounge area to take a break and play video games and watch movies.", image: "https://www.concretedisciples.com/media/reviews/photos/original/04/43/de/20021_petalumaramprats3_1294857363.jpg", website: 'http://www.norcalramprats.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1004 Lakeville St.' },
      { name: "Piedmont Skatepark", city_id: 330, state_id: 5, country_id: 1, description: "The one good part is the 'tuning fork' bowl which is fun. It's a tiny park with only a few workable elements. It has a weird snake run that goes uphill (!?) A pyramid that is about 8 inches high, a couple grind rails and the bowl. All fenced in with a monitor to make sure you wear your pads. ", image: "https://www.concretedisciples.com/media/reviews/photos/original/62/33/cd/19587_piedmontskatepark8opt_1294857623.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Moraga Ave and Red Rock Rd' },
      { name: "Joes Skatepark", city_id: 331, state_id: 5, country_id: 1, description: "18,500 sf - 6' bowl combinations, 4' spine, beginner and intermediate street course areas", image: "https://www.concretedisciples.com/media/reviews/photos/original/17/cc/f9/19588_placervilleskatepark2_1294857800.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '216 Armory Rd.' },
      { name: "Pleasanton Skatepark", city_id: 332, state_id: 5, country_id: 1, description: "It looks very small with a bowl, some street rail stuff and some weird triple hump type thing(?!)", image: "https://www.concretedisciples.com/media/reviews/photos/original/8c/53/06/19590_pleasantonskatepark4_1294858167.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Stoneridge Dr and Johnson Dr' },
      { name: "Pleasanton Skate Park", city_id: 332, state_id: 5, country_id: 1, description: "It's 5 obstacles in a round shaped slab of concrete on a slight incline. A set of stairs with no hand rail, a hip, a rectangular manual pad and a 4 foot high rectangle that is of no use", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/de/98/eb/19589_pleasantonskateboardpark1_1294857928.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Hopyard Rd and Parkside Dr' },
      { name: "Portola Skatepark", city_id: 335, state_id: 5, country_id: 1, description: "Two smooth 3' half bowls with 1 -1/2' concrete divider, no spine. Fun steep octagonal pyramid- some fun flat banks. Nothing special but the bowls are fun to mini ramp and flow around.", image: "https://concretedisciples.com/wp-content/uploads/2015/08/media_reviews_photos_original_b1_b9_19_portola-skatepark-40-1439680576.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '501 South Gulling St' },
      { name: "Quicy Skatepark", city_id: 336, state_id: 5, country_id: 1, description: "5' bowl, half pipe and spine ramp and street course.", image: "https://www.concretedisciples.com/media/reviews/photos/original/2b/78/d7/19591_quincyskatepark2_1294858380.jpg", website: 'http://users.psln.com/recdept/parks.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1308 pioneer rd.' },
      { name: "Red Bluff Skatepark", city_id: 338, state_id: 5, country_id: 1, description: "This park is great this is just the original plans but the transitions are great the overall flow is awesome it has a beginner area but all the good skaters love to improve the invert skills on it the kidney shaped bowl goes from 6 foot on the south side then drops down and the north side is 12 foot it also has the spine transfer in to the 6 foot bowl which is awesome it smooth the coping is perfect and every one loves to ride it its always packed plus its pretty big.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_ae_59_e7_20753_redbluffskatepark1_1294859397.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '658 Diamond Ave' },
      { name: "Redding Skatepark", city_id: 339, state_id: 5, country_id: 1, description: " There is a snake run that is actually skatable unlike other parks with a handrail down the pyramid. It is fun and who ever rated it bad never skated it. A Free, concrete, outdoor park. Very Small and has a lousy snakerun and shitty coping.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_92_f0_de_19604_reddingskatepark1_1294859570.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Lake Redding Park' },
      { name: "Phil Shao Memorial Skatepark", city_id: 342, state_id: 5, country_id: 1, description: "This is a nice park in a nice park. Big bowl (vert extension for the tranny people and plenty of street stuff for the tech/flip/ledge set. It's a fun park and only about 15 minutes north of SUNNYVALE. Smooth concrete work and lots of lines. For sure stop by if you are in the area. Bring a broom because there are lots of trees in the park and there is debris in the bowl from time to time.", image: "https://www.concretedisciples.com/media/reviews/photos/original/95/be/a0/19605_redwoodcityskatepark1_1294859707.jpg", website: 'http://www.ci.redwood-city.ca.us/parks/parksandpools/skatepark.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1400 Roosevelt Avenue' },
      { name: "Nichol SkatePark", city_id: 343, state_id: 5, country_id: 1, description: "Outdoor concrete skatepark, free.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '3230 Macdonald Ave' },
      { name: "Rio Vista Skate Park", city_id: 344, state_id: 5, country_id: 1, description: "Skatewave Skatelite skatepark", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '789 St Francis Way' },
      { name: "Ripon Skatepark", city_id: 345, state_id: 5, country_id: 1, description: "Big free concrete outdoor park. Has good trannies and is currently one of the best parks in California.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_82_de_b0_19606_riponskatepark1_1294859847.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'N Wilma Ave and Hughes Ln' },
      { name: "Riverbank Skatepark", city_id: 346, state_id: 5, country_id: 1, description: "This place has the best flow, very well built and clean! If you skate tranny you'll love this bowl. Hands down my favorite park in the Stockton/Modesto area", image: "https://www.concretedisciples.com/media/reviews/photos/original/6d/86/ad/_0002383_1317855218.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'First and Santa Fe' },
      { name: "Rocklin Skatepark", city_id: 348, state_id: 5, country_id: 1, description: "Free outdoor concrete park.", image: "https://www.concretedisciples.com/media/reviews/photos/original/fe/43/2c/19607_rocklinopt_1294860427.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5300 5th St' },
      { name: "Roseville Skatepark", city_id: 349, state_id: 5, country_id: 1, description: "Spohn Ranch Ramps, not sure about the crete", image: "https://www.concretedisciples.com/media/reviews/photos/original/b9/d0/4a/19609_rosevilleskatepark2_1294860560.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1550 Maidu Dr.' },
      { name: "Regency Skatepark", city_id: 350, state_id: 5, country_id: 1, description: "Pretty minimal skatepark. A very tiny mini ramp. A tiny rails, a quarter pipe with channel and no bottom lip section", image: "https://www.concretedisciples.com/media/reviews/photos/original/5d/c2/90/regency-skatepark-sacramento-86-1574824282.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5500 Honor Pkwy' },
      { name: "Wild Rose Skatepark and Snake Run", city_id: 350, state_id: 5, country_id: 1, description: "This is a really fun little neighborhood park. The snake run is promising some flow lines. It was too windy for me when I visited, but it is definitely a good warm up skatepark or just a cruise and chill place.", image: "https://www.concretedisciples.com/media/reviews/photos/original/35/b2/16/wild-rose-skatepark-and-snake-run-sacramento-32-1503320135.jpg", website: 'http://www.cityofsacramento.org/ParksandRec/Parks/Park-Directory/North-Natomas/Wild-Rose-Park?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '5200 Kankakee Drive' },
      { name: "McClatchy Park Skatepark", city_id: 350, state_id: 5, country_id: 1, description: "Free outdoor concrete park", image: "https://concretedisciples.com/wp-content/uploads/2014/08/media_reviews_photos_original_07_cc_88_mcclatchy-park-skatepark-sacramento-11-1407869425.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'McClatchy Park' },
      { name: "Tanzanite Skatepark", city_id: 350, state_id: 5, country_id: 1, description: "This skatepark is awesome. It covers all the needs of skaters beginner to pro with a wide variety of terrain. Free and open to the public, its something I wish every community had.", image: "https://www.concretedisciples.com/media/reviews/photos/original/fe/ec/a8/tanzinite-skatepark-sacramento-california-usa-70-1574821578.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Tanzanite Way and Bilsted Way' },
      { name: "Granite Skatepark", city_id: 350, state_id: 5, country_id: 1, description: "There looks to be lots of bowls, oververt, and a fullpipe.", image: "https://www.concretedisciples.com/media/reviews/photos/original/12/96/72/20633_sacramentogranite6_1294860739.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Ramona Ave and Cucamonga Ave.' },
      { name: "28th and B Skatepark", city_id: 350, state_id: 5, country_id: 1, description: "Skaters are invited to ollie and grind our indoor street course of quarter pipes, fun boxes and grind rails. All sessions are supervised. All participants are required to wear helmet, knee and elbow pads. A limited number are available to rent for $1 per session.", image: "https://www.concretedisciples.com/media/reviews/photos/original/7b/0a/ef/20596_28thbbowlpark_1354046295.jpg", website: 'http://www.cityofsacramento.org/parksandrecreation/recreation/skateboard.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '20 28th St.' },
      { name: "Salilnas Skatepark", city_id: 351, state_id: 5, country_id: 1, description: "There are lights at this skate park.", image: "https://www.concretedisciples.com/media/reviews/photos/original/09/90/88/salilnas-skatepark-salinas-california-usa-16-1525971202.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Constitution Blvd At Las Casitas' },
      { name: "Flower Shop DIY", city_id: 356, state_id: 5, country_id: 1, description: "DIY bowl in SF. Really fun and unique spot with a variety of different transitions including an oververt wall. Most of the walls are pretty gnarly and the spot in general is VERY tight.", image: "https://www.concretedisciples.com/media/reviews/photos/original/10/bd/60/flower-shop-diy-san-francisco-97-1489760476.png", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: "NA" },
      { name: "SoMa Skate Plaza", city_id: 356, state_id: 5, country_id: 1, description: "Rad park in downtown SF, lots of street elements and the park is set up more or less in a line with one obstacle leading to the next and ending in the bowled doorway. Very little tranny aside from the door; there's a transitioned column that's quite steep and a China wall style quarter at the opposite end.", image: "https://www.concretedisciples.com/media/reviews/photos/original/09/4a/87/soma-skate-plaza-san-francisco-67-1489759749.png", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Duboce Ave and Stevenson St.' },
      { name: "Balboa Skatepark", city_id: 356, state_id: 5, country_id: 1, description: "Outdoor skatelite skatepark", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/3d/d1/97/BUcL5ZSVQ7g-v1393269413.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Ocean ave and San Jose ave' },
      { name: "Potrero Del Sol Skatepark", city_id: 356, state_id: 5, country_id: 1, description: "Outdoor concrete park with restrooms.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_videos_original_be_3b_4c_2LYSYpJImK0.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Potrero Ave and Cesar Chavez' },
      { name: "Crocker Amazon Skatepark", city_id: 356, state_id: 5, country_id: 1, description: "Park terrain: One good sized bowl is in the center of the park, and on the outside edge there are several ledges and a pyramid. Helmets are required.", image: "https://www.concretedisciples.com/media/reviews/photos/original/24/91/46/19610_sanfranciscoskatepark_1294861115.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1600 Geneva Ave.' },
      { name: "Roosevelt Park", city_id: 358, state_id: 5, country_id: 1, description: "The pool is real whippy and fun. The tranny course is not bad, fun to be had. A downhill into a 1/4 that people are ripping. Cute chick skaters that can shred too.", image: "https://www.concretedisciples.com/media/reviews/photos/original/bf/46/c3/21347_rooseveltskatepark1_1294861375.jpg", website: 'http://www.sjparks.org/Skateboard/skateboard.asp?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Santa Clara St. and 20th St.' },
      { name: "Stonegate Skatepark", city_id: 358, state_id: 5, country_id: 1, description: "Outdoor concrete park.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Tuers Rd. and Gassmann Dr.' },
      { name: "Cunningham Regional Skatepark", city_id: 358, state_id: 5, country_id: 1, description: "Get some! Possibly the largest park in CA.", image: "https://www.concretedisciples.com/media/reviews/photos/original/b5/a6/8f/20929_lakecunninghamskatepark4_1293308765.jpg", website: 'http://www.sjparks.org/Skateboard/index.asp?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '2305 S White Rd.' },
      { name: "Plata Arroyo Skatepark", city_id: 358, state_id: 5, country_id: 1, description: "Small skatepark, seemed poorly designed. The bigger bowl didn't any vert, and the smaller bowl had no coping. The worst was the bark that was laid around the perimeter of the place.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/81/04/fb/20733_sanjoseskatepark1_1294861530.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '168 N King Rd' },
      { name: "Great Oaks Skatepark", city_id: 358, state_id: 5, country_id: 1, description: "It is an ok skatepark. Disadvantages are its made on a slant, so you pick up lots of speed. It's a fairly decent street course. A pyramid with hand rail and box. Big 5 stair with a handrail and ledge attached. There's a few fun boxes and a 5 foot half pipe.", image: "https://www.concretedisciples.com/media/reviews/photos/original/b1/a6/82/20401_greatoaksskatepark2_1294861271.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '5200 Snow Dr.' },
      { name: "Mayfair Park", city_id: 358, state_id: 5, country_id: 1, description: "This medium size street plaza packs a lot in with a Pier 7 block, a two stair, seven stair, two types of handrails, hubbas, manual pads, euro gap, a bank to wall and a long quarter pipe.", image: "https://www.concretedisciples.com/media/reviews/photos/original/1b/9e/73/P3240085-11-1370623992.jpg", website: 'http://www.sanjoseca.gov/facilities/Facility/Details/58?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '2039 Kammerer Ave.' },
      { name: "Thrasher Park", city_id: 360, state_id: 5, country_id: 1, description: "Thrasher Skatepark, a free, concrete, outdoor park. No pads required. Has a small 3/4 bowl, some trannies, steep slants, and a funbox.", image: "https://www.concretedisciples.com/media/reviews/photos/original/d3/0a/9b/19611_SLPARK1opt_1294861711.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Davis St. and Doolittle Dr.' },
      { name: "Arroyo Skatepark", city_id: 361, state_id: 5, country_id: 1, description: "It is a good level skate park with woodward equipment. There is only a quarter pipe, a kicker, another kicker with a box attached to it and a fun box with a two stair type thing attached to it. Oh ya and a couple of rails.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_52_5c_03_18923_sanlorenzoskatepark1_1294861857.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '15837 Nielson Ave' },
      { name: "San Mateo Skatepark", city_id: 364, state_id: 5, country_id: 1, description: "This is a very street oriented skatepark. Lots of ledges and a couple rails.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '928 Ocean View Ave' },
      { name: "San Rafael Skatepark", city_id: 366, state_id: 5, country_id: 1, description: "Anyway the park is a joke but does have a good peanut bowl that is probably 10' with some vert. The rest of the park looks like fun for a goof around style session. Another example of a waste of concrete for the most part.", image: "https://www.concretedisciples.com/media/reviews/photos/original/b9/d6/03/19612_sanrafaelskatepark1_1294862009.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Smith Ranch Road' },
      { name: "San Ramon Skatepark", city_id: 367, state_id: 5, country_id: 1, description: "This is a mess too many obstacles in too little a space. The mini bowl is kind of fun but 5 foot banks that go to vertical?! There's stairs, rails a dinky manual pad and the aforementioned vert banks and the mini bowl. Criss crossing lines lead to many collisions. Lots of little yuppie offspring. It has lights that are on until 10 or 11. Helmets required.", image: "https://www.concretedisciples.com/media/reviews/photos/original/64/5d/83/19613_sanramonskatepark4_1294862137.jpg", website: 'http://www.ci.san-ramon.ca.us/srteen/skatepark.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Bollinger Canyon Road and Market Place' },
      { name: "Grind Out Hunger", city_id: 373, state_id: 5, country_id: 1, description: "Our facility is open to the general public for free, however if you are wanting to skate you MUST have a signed/notarized waiver on file with us. Helmets are required to skate and you must bring your own equipment. Skateboards only.", image: "https://www.concretedisciples.com/media/reviews/photos/original/bd/06/af/_grindouthungersc_1366673362.jpg", website: 'http://www.grindouthunger.org/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '912 41st Ave.' },
      { name: "Derby Skatepark", city_id: 373, state_id: 5, country_id: 1, description: "This park has been around since the 1970's and is not modern by any means. But it is legendary none the less. It is a very shallow snake run and not much more.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_ad_aa_fb_21293_santacruzderby_1339344836.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '400 Woodland Way' },
      { name: "City of Santa Cruz Skatepark", city_id: 373, state_id: 5, country_id: 1, description: "The bowl complex and the pool here are better than any of the tranny elements at the Sacto park, in my opinion.", image: "https://www.concretedisciples.com/media/reviews/photos/original/96/68/52/20771_santacruzskatepark7_1294862438.jpg", website: 'http://www.ci.santa-cruz.ca.us/pr/parksrec/skateparkmikefox.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '225 San Lorenzo Blvd' },
      { name: "Santa Rosa Skatepark", city_id: 375, state_id: 5, country_id: 1, description: "It's free, concrete and outdoors. One of the earliest Norcal free public skateparks. Mostly snake runs with hips to blast off.", image: "https://www.concretedisciples.com/media/reviews/photos/original/6c/67/94/19034_santarosaskatepark2_1363286728.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1725 Fulton Rd.' },
      { name: "Scotts Valley Skatepark", city_id: 377, state_id: 5, country_id: 1, description: "As part of my recent journalism assignment for Concrete Wave magazine, I have seen a number of skate parks in Central California. I would have to say that this one is among the best that I've seen.", image: "https://www.concretedisciples.com/media/reviews/photos/original/5a/26/be/18998_scottsvalleyskatepark1_1294869555.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '361 Kings Village Road' },
      { name: "Laguna Skate Garden", city_id: 378, state_id: 5, country_id: 1, description: "The pool design looks trippy, I am not sure if this the final shape or not. Tom Max from our boards says it is well underway, pour has already started. This is rural nor cal, wine country.", image: "https://www.concretedisciples.com/media/reviews/photos/original/6c/0a/b9/21149_design_1294869013.jpg", website: 'http://www.sebsk8.org/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Laguna Park Way and Flynn St.' },
      { name: "Selma Skatepark", city_id: 379, state_id: 5, country_id: 1, description: "The street is a mini plaza and the tranny element is a nice 10 foot amoeba bowl", image: "https://www.concretedisciples.com/media/reviews/photos/original/cd/04/90/20799_selmaskatepark1_1294868844.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Whitson & Second St' },
      { name: "Shafter Skatepark", city_id: 380, state_id: 5, country_id: 1, description: "It's not to bad it kinda small but cool.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '336 Pacific Avenue' },
      { name: "Shasta Lake City Skatepark", city_id: 381, state_id: 5, country_id: 1, description: "The park is about 10 miles north of Redding, Ca. It has been around for about 1 year. It has a pyramid, quarterpipe, and other 'street like' things. It isn't bad but it is pretty small. The park is concrete and it is free. Pads are not inforced, even though there is a cop station across the street they don't even care.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_videos_original_3a_1c_f7_hNsm2-6RHvk-v1471886032.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1525 Median Ave' },
      { name: "Soledad Skatepark", city_id: 383, state_id: 5, country_id: 1, description: "Skatewave", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Ticino St & Soledad St' },
      { name: "Sonoma Skatepark", city_id: 384, state_id: 5, country_id: 1, description: "It is a good skatepark. It has one hand rail, a 5 stair, a smaller round rail and 3 bowls.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'W Verano Ave and Arnold Dr' },
      { name: "Sonora Skatepark", city_id: 385, state_id: 5, country_id: 1, description: "In the center of the park is a lumpy snake run that has a bowl at either end of it. The snake runs from about 3 ft to 5 ft. It's rough with kinda gnarly transitions so if you like that kind of thing go for it. There are misc. fun box thingys, a few rails, a 2.5 foot quarter pipe, and a 6 ft roll-in bank with a curb on top of it. The park also has a bowled in corner that stands at about 6.5 ft high.", image: "https://www.concretedisciples.com/media/reviews/photos/original/fc/fe/7a/19544_sonoraskatepark1_1294869132.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '330 Greenley Rd.' },
      { name: "Bijou Skatepark", city_id: 386, state_id: 5, country_id: 1, description: "This is a smaller fun park that has recently been rebuilt. It used to be a bunch of asphalt and concrete patched together, but is now all concrete with some new trannies and an eight footer with some vert. ", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/b1/28/0e/21390_slaketahoskatepark1_1294869679.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Al Tahoe Blvd.' },
      { name: "St. Helena Skatepark", city_id: 388, state_id: 5, country_id: 1, description: " It has an organic feeling to it. You just keep rolling and rolling and rolling. So many little whips and banks and trannys around the outside of a sick, pool tranny pool and a big smooth, clean flow bowl. The surrounding park allows picnics and beer, but the pigs roll by often and hang out looking for pad violations.", image: "https://www.concretedisciples.com/media/reviews/photos/original/9d/d8/6c/21364_st.helenaskatepark4_1294869793.jpg", website: 'http://www.sthelenaskatepark.org/index.html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '464 Crane Ave.' },
      { name: "Stockton Skatepark", city_id: 389, state_id: 5, country_id: 1, description: "Pretty small but sections are linked pretty well, so with a little understanding of the park (which took all of 15 minutes), you can create some fun lines. It gets crowded with all the bikers, scooters and skaters scrambling for runs. Nothing bigger than 7-8 feet.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '6000 N. El Dorado St.' },
      { name: "Lake Wood Skatepark", city_id: 390, state_id: 5, country_id: 1, description: "nice little skate park. good street course", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/62/fa/33/20186_sunnyvale2skatepark1_1294870064.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '834 Lakechime Drive' },
      { name: "Sunnyvale Skatepark", city_id: 390, state_id: 5, country_id: 1, description: "This park is for those of you that like to carve and go fast. It basically consists of two bowls, one about 4 ft the other from 5 to 8 ft deep. There are some street elements there too on the perimeter. Set of stairs, all kinds of ledges to get your tech on but this park is about flow. It's in Fair Oaks Park and it's really nice. There is a 7-11 about 5 blocks down the road. Friendly locals.", image: "https://www.concretedisciples.com/media/reviews/photos/original/f7/ff/da/19617_sunnyvaleskateparkca4_1294869931.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '460 N. Wolfe Rd.' },
      { name: "Memorial Skatepark", city_id: 391, state_id: 5, country_id: 1, description: "All the banks have negligible radius to the flat; it's like skating a ditch but with tighter banks. Quarters are tight radius with a bit of vert to steel coping.", image: "https://www.concretedisciples.com/media/reviews/photos/original/86/ed/af/memorial-skatepark-susanville-71-1439481192.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1195 North St.' },
      { name: "Templeton Skatepark", city_id: 391, state_id: 5, country_id: 1, description: "Great park, well used spaces", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/8f/bb/da/19618_Templeton1_1294870325.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '6th Street and S Main Street' },
      { name: "China Town Skatepark", city_id: 394, state_id: 5, country_id: 1, description: "Small, small rail, small Kickers and small Ramps. Its cool to be there but its real small and peacefull and hidden. if yuo find it you'll prbobly like it", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'W Grant Line Rd and Parker Ave' },
      { name: "Truckee Skatepark", city_id: 395, state_id: 5, country_id: 1, description: "It's concrete, with metal coping everywhere. 4 perfect bowls make up this free skatepark, and once you drop in, you never have to push again!! Besides the 4 bowls, there are some flat walls, hips, corners, and banks. Awesome! Also, no pads are required. Unfortunately, the biggest wall in this park is 5 ft. high. On weekends the park is packed with groms who get in the way", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/2a/fd/29/19619_truckee_1294870441.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Estates Dr. and Brockway Rd.' },
      { name: "Tulare Skatepark", city_id: 396, state_id: 5, country_id: 1, description: "Couple of concrete bowls and a small street spot.", image: "https://www.concretedisciples.com/media/reviews/photos/original/dd/ea/56/21219_tulareskatepark3_1294870544.jpg", website: 'http://www.tulareparksandrec.com/parks/parks.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Tulare and I Street' },
      { name: "Turlock Skatepark", city_id: 397, state_id: 5, country_id: 1, description: "This park is ramps and situated on a flat slab of cement. It is outdoors.", image: "NA", website: 'http://www.ci.turlock.ca.us/municipalcode/read.asp?folder=%7CTitle_10%7C1%7C20..html?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Starr Ave. and N. Denair Ave.' },
      { name: "Ukiah Skatepark", city_id: 398, state_id: 5, country_id: 1, description: "Pretty nice bowl section with a deep portion that has 2 feet of vert, and cradel-ish slightly oververt pocket, plus fun kiddie pool... smooth black pool cope all around. Nice street section with wall ride-banks, and other redundant street crap.", image: "https://www.concretedisciples.com/media/reviews/photos/original/dc/77/f7/21737_ukiahskatepark4_1302109821.jpg", website: 'http://www.ukiahskatepark.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'West Low Gap St' },
      { name: "Union City Skatepark", city_id: 399, state_id: 5, country_id: 1, description: "Concrete park outdoors.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/4e/d4/2b/19117_unioncityskatepark1_1294870852.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Royal Ann Dr and Alvarado Niles Rd' },
      { name: "Vacaville Skatepark", city_id: 400, state_id: 5, country_id: 1, description: "Pay to ride, pads are required, concrete.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Alamo Dr and Marshall Rd' },
      { name: "Wardlaw Skate Park", city_id: 401, state_id: 5, country_id: 1, description: "fun bowl, only about 8' deep pool, lots of coping and some fun corners, dog park right beside it", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1805 Ascot Pkwy' },
      { name: "Providence Skatepark", city_id: 404, state_id: 5, country_id: 1, description: "It's a tight skate park. Its pretty big and it has good rails, banks, and it's hella fun to carve it up", image: "https://www.concretedisciples.com/media/reviews/photos/original/bf/ba/47/19621_providenceskateparkvisaliaca3_1294870957.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '300 N. Jacob st.' },
      { name: "Walnut Creek Skatepark", city_id: 405, state_id: 5, country_id: 1, description: "Nice transitions and such, a little heavy on the litter though and the small deep kidney is sort of tight but overall, a nice place.", image: "https://www.concretedisciples.com/media/reviews/photos/original/9e/9d/c3/19210_walnutcreekskatepark1_1294871053.jpg", website: 'http://www.ci.walnut-creek.ca.us/Skate%20park/skate%20park%20homepage.htm?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: 'Heather Drive and Marchbanks Drive' },
      { name: "Watsonville Skatepark", city_id: 406, state_id: 5, country_id: 1, description: "The street area makes a triangle loop around a kidney/ameoba shaped pool with faux-tile and pool coping. Pretty steep drop in in shallow, but looks well-built. Nice use of colored-concrete throughout whole park. Street stuff has creative mix of quarters, banks, rails, manny, ledges, etc. Even though there is separate 'lanes' for traffic, still easy to have cross traffic here.", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/100x100c/b0/a3/cd/sXEvdHdV1eQ-v1475208870.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1301 Main St.' },
      { name: "Ramsey Skatepark", city_id: 406, state_id: 5, country_id: 1, description: "A newer concrete park opened up to replace the ramp ark in summer 2016", image: "https://www.concretedisciples.com/media/reviews/videos/thumbnail/300x300s/15/7e/36/sXEvdHdV1eQ-v1481086546.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'Main St.' },
      { name: "Weed Skatepark", city_id: 408, state_id: 5, country_id: 1, description: "Outdoor concrete. free. large bowl with some mound hips.", image: "https://www.concretedisciples.com/media/reviews/photos/thumbnail/300x300s/07/db/c1/20782_weedskatepark1_1294871143.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '1299 Railroad Ave' },
      { name: "Willits Skatepark", city_id: 411, state_id: 5, country_id: 1, description: "The Willits Skate Park is 18,500 square feet with an eight foot bowl and many street elements.", image: "https://concretedisciples.com/wp-content/uploads/2010/12/media_reviews_photos_original_aa_cc_a0_18988_willitsskatepark_1294871358.jpg", website: 'http://www.willitsskatepark.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '75 North Main Street' },
      { name: "Pat Elsbree Skatepark", city_id: 412, state_id: 5, country_id: 1, description: "Free concrete skatepark with restrooms.", image: "https://www.concretedisciples.com/media/reviews/photos/original/2f/94/8a/20089_windsorskatepark1_1294871498.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '9680 Brooks Road South' },
      { name: "Yreka Skatepark", city_id: 415, state_id: 5, country_id: 1, description: "It's just a fun box, a quarter pipe and a rail. For a better time skating in Yreka, go to the high school on the northside. There's a quad with ledges on the main campus and an awesome rideable wall and grindable ledge w/ a rail and stairs on Knapp St by the football field.. The College of the Siskiyous on the southside is a good spot, too. When I was young, we would skate on top of the Bottling Works Mall where it's a natural halfpipe, but I didn't tell you that. There used to be a dope indoor park in Yreka called Rolling Thunder. Yreka is worth a day trip for skating if you've never been there.", image: "NA", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: 'W. Miner Street and Gold Street' },
      { name: "Church of Glad Tidings Skatepark", city_id: 416, state_id: 5, country_id: 1, description: "The Church of Glad Tidings built this permanent concrete park for the local youth - mostly street plaza with lots of rails, stairs and ledges, plus a mini ramp size half pipe in the middle.", image: "https://www.concretedisciples.com/media/reviews/photos/original/30/70/35/2-86-1370625011.jpg", website: 'http://www.churchofgladtidings.com/?phpMyAdmin=3f9c2261661fdcb058fe59d8ac271897', createdAt: new Date(), updatedAt: new Date(), address: '1179 Eager Road' },
      { name: "Yuba City Skatepark", city_id: 416, state_id: 5, country_id: 1, description: "It's free, concrete and outdoors. It's trademark is a cloverbowl with each pocket being 4,6,8 feet deep. Also some other quarter pipes banks, a large funbox, spine, and taco thing. It's open until 10 p.m. every night.", image: "https://www.concretedisciples.com/media/reviews/photos/original/aa/32/95/19622_yubaskatepark1_1346106830.jpg", website: "NA", createdAt: new Date(), updatedAt: new Date(), address: '859 Gray Ave' }
